import { createSlice, PayloadAction} from "@reduxjs/toolkit";
import {AuthService} from "../../services/authService";

type FetchState = {
    id: number,
    userId: string,
    password: string,
    username: string,
    description: string,
    image: string,
    url: string,
    createdAt: string,
    updatedAt: string,
    token: string
}

export type SignInState = {
    loading: boolean,
    error: string | null,
    data: FetchState,
}

const initialState: SignInState = {
    loading: false,
    error: null,
    data: {
        id: 0,
        userId: '',
        password: '',
        username: '',
        description: '',
        image: '',
        url: '',
        createdAt: '',
        updatedAt: '',
        token: ''
    }
}

export const fetchSignInSlice = createSlice({
    name: 'signIn',
    initialState,
    reducers: {},
    extraReducers: (builder) => {
        builder
            .addCase(AuthService.signIn.pending, (state, action) => {
                console.log('pending');
            })
            .addCase(AuthService.signIn.fulfilled, (state, action) => {
                console.log('fulfilled');
            })
            .addCase(AuthService.signIn.rejected, (state, action) => {
                console.log('rejected');
            })
    }
});

// export const { setCounter } = fetchSignInSlice.actions;

export default fetchSignInSlice;
